do',NULL,'No ha seleccionado',NULL,'No ha seleccionado',NULL,'No ha seleccionado',NULL,'No ha seleccionado',NULL,'No ha seleccionado',NULL,'No ha seleccionado',NULL,'No ha seleccionado','La principal recomendacion que se ha hecho desde diferentes perspectivas (par académico, egresados, residentes, docentes)  es la consolodacion de un centro de practica.\r\n\r\nNo existen centros de practicas de atención primaria en la ciudad que cumplan las caracteristicas requeridas para un centro docente que furera equiparable al concepto de \"Hospital Universitario\" deseado.\r\n\r\nEsta coyuntura requeiere un trabajo extra al de cualquier otro posgrado para poder consolidar una propuesta que en prospectiva permita desarrollar un concepto viable en la realidad y atractivo para consolidad  una relacion docencia servicio a largo plazo.  Este esfuerzo requiere coordinar acciones al interior de la Universidad y en los sitiops de practica que sea coherente con el documento que debe estar listo para el Ministerio de Educación a principios de 2012.   \r\n\r\nLa persona que ocupe este cargo debe ser un médico familiar y será un apoyo para el cuerpo docente y la direccion del posgrado en la tarea anteriormente descrita.   Elcurpo codente bajo la direccion de este posgrado esta investigando y preparando documentos acerca del rol del médico familiar en el mundo y su contraste con el papel y rol que juegan en el país en el contexto de la atención primaria en salud.   Se espera que durante el proximo año estos documentos  sean publicados en revistas indexadas y sean un apoyo importante para el trabajo que realizará la coordinación solicitada.',NULL,'No ha seleccionado','No ha seleccionado',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'No ha seleccionado','No ha seleccionado',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'No ha seleccionado','No ha seleccionado',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'No ha seleccionado','No ha seleccionado',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'No ha seleccionado','No ha seleccionado',