 a las profesión, por lo cual el nivel de formación disciplinar profesional y docente son dos elementos indispensables.\r\nComo cracterìsticas profesionales se considera que el docente tenga formaciòn profesional relacionadas con el Areac de Ciencias de la Salud o en Ciencia Biològicaas (Mèdico, Odontòlogo, Terapista, Biòlogo, Microbiólogo, Bacteriólogo, Quìmico, Ing. Quìmico etc), con formaciòn avanzada (Especialidad, Maestrìa, en àrea s afines y que tenga como interès el àrea de trabajo, la formación en la misma asì como tambièn en docencia, pegagogìa y otras que se relacionen.\r\nEl proceso de formación del docente de Ciencia Bàsicas Biomèdicas, le debe permitir aprender o aplicar metodologìa  que garanticen situaciones de aprendizaje significativo.\r\nPor su ubicaciòn en el plan de estudios,  deben ser grandes promotores de la fundamentación científica en los estudiantes, deben lograr cabios en la conducta dirigidos  hacia la incorporación de ellos a la vida universitaria y al estudio de la profesión con las responsabilidades que esto demanda, a través de valores èticos y apoyando permanentemente al estudiante en la bùsqueda de la excelencia acdémica.','Talleres, seminarios y otras','Semanal','Ejecucion',NULL,NULL,NULL,NULL,NULL,NULL,'Clases magistrales','Semanal','Ejecucion',NULL,NULL,NULL,NULL,NULL,NULL,'Actividades pràcticas','Semanal','Ejecucion',NULL,NULL,NULL,NULL,NULL,NULL,'Desarrollo de evaluaciones','Mensual','Ejecucion',NULL,NULL,NULL,NULL,NULL,NULL,'Tutorías de seguimiento','Semanal','Ejecucion',NULL,NULL,NULL,NULL,NULL,NULL,'Participar en actividades de la facultad ','Trimestral','Retroalimentacion',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'No ha seleccionado','No ha seleccionado',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'No ha seleccionado','No ha seleccionado',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'No ha seleccionado','No ha seleccionado',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'No ha seleccionado','No ha seleccionado',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'No ha selecci