  `Cargo` varchar(200) default NULL COMMENT 'Cargo del solicitante',
  `Categor` varchar(200) default NULL COMMENT 'Categoria del cargo solicitante',
  `CentroCo` varchar(50) default NULL COMMENT 'Centro de costo',
  `FechaIni` date default NULL COMMENT 'Fecha inicial',
  `FechaFin` date default NULL COMMENT 'Fecha final',
  `AsigDesc` varchar(255) default NULL COMMENT 'Asignaturas - Descripción',
  `AsigDedi` varchar(255) default NULL COMMENT 'Asignaturas - Dedidación',
  `TallDesc` varchar(255) default NULL COMMENT 'Talleres - Descripción',
  `TallDedi` varchar(255) default NULL COMMENT 'Talleres - Dedidación',
  `PracDesc` varchar(255) default NULL COMMENT 'Prácticas - Descripción',
